import React from 'react';
import Project from './Project.jsx';

const List = () => {
  const projects = [
    { name: 'Tienda Virtual' },
    { name: 'Tienda Virtual' },
    { name: 'Tienda Virtual' },
  ];
  return (
    <>
      <ul className='listado-proyectos'>
        {projects.map((project) => (
          <Project project={project} />
        ))}
      </ul>
    </>
  );
};

export default List;
